import React from 'react';
import './AboutMe.css';

const AboutMe = ({id}) => {
    return(
            <div className = 'vh-100 w-75 center mt5' id = {id}>
                <div className = 'border-height'>
                    <h1 className = 'tc pt5 fw5'>About Me</h1>
                    <div className = 'bb w-75 center'>
                    </div>
                </div>
            </div>
 );
}

export default AboutMe;
